import React, { Component } from 'react';
import "bulma/css/bulma.css";
import './Contact.css';
import Profile from '../Images/Profile.JPG'
import Phone from '../Images/phone.png'
import Email from '../Images/email.png'

class Resume extends Component {
  constructor(props) {
    super(props)
  }

  render() {
    return (

      <div class="card column is-6 is-offset-3" style={{backgroundColor:"transparent",bordear:"5px black solid",borderRadius:"25px",marginTop:"20%",boxShadow: "0px 0px 0px"}}>

        <div className = "card column is-10 is-offset-1" style={{backgroundColor:"transparent",paddingTop:"5%",paddingBottom:"5%",boxShadow: "0px 0px 0px",borderRadius:"25px"}}>

                  <div class="title is-3" style={{textAlign:"center"}}>
                  Questions or Feedback?

                  Contact me!

                  </div>
                  <hr style={{border:"1px solid black"}}/>

                  <div className="columns">
                  <div className="column is-half">
                  <span class="icon" style={{float:"left"}}>
                    <img class="is-rounded"src={Phone} alt="Placeholder image"/>
                  </span>
                  <div class="subtitle is-5" style={{textAlign:"center"}}>
                    <div class="title is-5" style={{float:"left", marginRight:"2%",  marginLeft:"2%"}}>
                      Phone:
                    </div>
                    978-270-4538
                  </div>
                  </div>
                  <div className="column is-half">
                  <span class="icon" style={{float:"left"}}>
                    <img class="is-rounded"src={Email} alt="Placeholder image"/>
                  </span>
                  <div class="subtitle is-5" >
                  <div class="title is-5" style={{float:"left", marginRight:"2%",  marginLeft:"2%"}}>
                    Email:
                  </div>
                  brendmm@vt.edu
                </div>
                </div>
                </div>

            </div>

        </div>
    )
  }
}

export default Resume
